t: +1 to ship''s radar sensor strength', '34_12', '1', '0', '1', '0', '1', '0', '0', '618'), ('32102', '300', 'Low-grade Grail Beta', 'This memory augmentation has been modified by Amarr scientists for use by their elite officers.\r\n\r\nPrimary Effect: +2 Bonus to Memory\r\n\r\nSecondary Effect: +1 to ship''s radar sensor strength', '31_15', '1', '0', '1', '0', '1', '0', '0', '619'), ('32103', '300', 'Low-grade Grail Delta', 'This cybernetic subprocessor has been modified by Amarr scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Intelligence\r\n\r\nSecondary Effect: +1 to ship''s radar sensor strength', '31_16', '1', '0', '1', '0', '1', '0', '0', '621'), ('32104', '300', 'Low-grade Grail Epsilon', 'This social adaptation chip has been modified by Amarr scientists for use by their elite officers.\r\n\r\nPrimary Effect: +2 Bonus to Charisma\r\n\r\nSecondary Effect: +1 to ship''s radar sensor strength', '31_14', '1', '0', '1', '0', '1', '0', '0', '622'), ('32105', '300', 'Low-grade Grail Gamma', 'This neural boost has been modified by Amarr scientists for use by their elite officers.\r\n\r\nPrimary Effect: +2 Bonus to Willpower\r\n\r\nSecondary Effect: +1 to ship''s radar sensor strength', '34_15', '1', '0', '1', '0', '1', '0', '0', '620'), ('32106', '314', 'Sansha Command Signal Receiver', 'This device can boost the incoming or outgoing signals to a Sansha device.', '10_09', '0', '40', '1', '0', '1', '0', '750', '0'), ('32107', '300', 'Low-grade Spur Alpha', 'This ocular filter has been modified by Gallente scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Perception\r\n\r\nSecondary Effect: +1 to ship''s magnetometric sensor strength', '34_12', '1', '0', '1', '0', '1', '0', '0', '618'), ('32108', '300', 'Low-grade Spur Beta', 'This memory augmentation has been modified by Gallente scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Memory\r\n\r\nSecondary Effect: +1 to ship''s m