tation chip has been modified by Caldari scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Charisma\r\n\r\nSecondary Effect: +1 to ship''s gravimetric sensor strength', '31_14', '1', '0', '1', '0', '1', '0', '0', '622'), ('32116', '300', 'Low-grade Talon Gamma', 'This neural boost has been modified by Caldari scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Willpower\r\n\r\nSecondary Effect: +1 to ship''s gravimetric sensor strength', '34_15', '1', '0', '1', '0', '1', '0', '0', '620'), ('32117', '300', 'Low-grade Jackal Alpha', 'This ocular filter has been modified by Minmatar scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Perception\r\n\r\nSecondary Effect: +1 to ship''s ladar sensor strength', '34_12', '1', '0', '1', '0', '1', '0', '0', '618'), ('32118', '300', 'Low-grade Jackal Beta', 'This memory augmentation has been modified by Minmatar scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Memory\r\n\r\nSecondary Effect: +1 to ship''s ladar sensor strength', '31_15', '1', '0', '1', '0', '1', '0', '0', '619'), ('32119', '300', 'Low-grade Jackal Delta', 'This cybernetic subprocessor has been modified by Minmatar scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Intelligence\r\n\r\nSecondary Effect: +1 to ship''s ladar sensor strength', '31_16', '1', '0', '1', '0', '1', '0', '0', '621'), ('32120', '300', 'Low-grade Jackal Epsilon', 'This social adaptation chip has been modified by Minmatar scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Charisma\r\n\r\nSecondary Effect: +1 to ship''s ladar sensor strength', '31_14', '1', '0', '1', '0', '1', '0', '0', '622'), ('32121', '300', 'Low-grade Jackal Gamma', 'This neural boost has been modified by Minmatar scientists for use by their elite officers. \r\n\r\nPrimary Effect: +2 Bonus to Willpower\r\n\r\nSecondary Effect: +1 to ship''s ladar sensor strength', '34_15', '1', '0', '1', '0', '1', '0', '0', '620'), ('32122', '300', 'Low-grade Grail Omega', 'This implant does nothing in and of itself, but when used in conjunction with other low-grade Grail implants it will boost their effect.\r\n\r\nPrimary Effect: +40% bonus to the strength of all low-grade Grail implant secondary effects. Not cumulative with high-tier Grail implant set', '40_16', '1', '0', '1', '0', '1', '0', '0', '1151'), ('32123', '300', 'Low-grade Jackal Omega', 'This implant does nothing in and of itself, but when used in conjunction with other low-grade Jackal implants it will boost their effect. \r\n\r\nPrimary Effect: +40% bonus to the strength of all low-grade Jackal implant secondary effects. Not cumulative with high-tier Jackal implant set', '40_16', '1', '0', '1', '0', '1', '0', '0', '1151'), ('32124', '300', 'Low-grade Spur Omega', 'This implant does nothing in and of itself, but when used in conjunction with other low-grade Spur implants it will boost their effect. \r\n\r\nPrimary Effect: +40% bonus to the strength of all low-grade Spur implant secondary effects. Not cumulative with high-tier Spur implant set', '40_16', '1', '0', '1', '0', '1', '0', '0', '1151'), ('32125', '300', 'Low-grade Talon Omega', 'This implant does nothing in and of itself, but when used in conjunction with other low-grade Talon implants it will boost their effect. \r\n\r\nPrimary Effect: +40% bonus to the strength of all low-grade Talon implant secondary effects. Not cumulative with high-tier Talon implant set', '40_16', '1', '0', '1', '0', '1', '0', '0', '1151'), ('32126', '526', 'Homemade Sansha Beacon', 'This wonder of science was made with a Sansha command signal receiver, the head of Rahsa, and pounds of electrician''s tape.', '43_16', '1', '1', '1', '0', '1', '0', '0', '0'), ('32127', '952', 'Linked Broadcast Array Hub', 'These arrays provide considerable added power output, allowing for an increased number of deployable structures in the starbase''s field of operation.', '', '459', '100', '27500', '2700', '1', '0', '0', '0'), ('32128', '226', 'LCO Partially Constructed Megathron', 'This Megathron battleship is partially complete, with decks and inner-hull systems exposed to the cold of surrounding space.', '', '539', '100000', '100000000', '10000', '1', '0', '0', '0'), ('32129', '226', 'LCO Small Armory', 'This small armory has a thick layer of reinforced tritanium and a customized shield module for deflecting incoming fire.', '', '700', '100000', '100000000', '10000', '1', '1', '0', '0'), ('32131', '226', 'LCO Starbase Capital Shipyard', 'A large hangar structure with divisional compartments, for easy separation and storage of materials and modules.', '', '600', '100000', '4000', '200000', '1', '0', '0', '0'), ('32132', '226', 'LCO Starbase Hangar', 'A stand-alone deep-space construction designed to allow pilots to dock and refit their ships on the fly.', '', '550', '100000', '1150', '8850', '1', '0', '0', '0'), ('32133', '226', 'LCO Megathron', 'The Megathron has established itself as one of the most feared and respected battleships around. Since its first appearance almost two decades ago it has seen considerable service in the troublesome regions on the outskirts of the Federation, helping to expand and defend Gallentean influence there.', '', '300', '0', '0', '0', '1', '8', '0', '0'), ('32134', '226', 'LCO Thorax', 'The Thorax-class cruiser is the latest combat ship commissioned by the Federation. While the Thorax is a very effective ship at any range, typical of modern Gallente design philosophy it is most effective when working at extreme close range where its blasters and hordes of combat drones tear through even the toughest of enemies.', '', '167.24', '0', '0', '0', '1', '8', '0', '0'), ('32135', '226', 'LCO Occator', 'Roden Shipyards Deep space transports are designed with the depths of lawless space in mind. Possessing defensive capabilities far in excess of standard industrial ships, they provide great protection for whatever cargo is being transported in their massive holds. They are, however, some of the slowest ships to be found floating through space.', '', '220', '0', '0', '0', '1', '8', '0', '0'), ('32136', '226', 'LCO Incursus', 'The Incursus is commonly found spearheading Gallentean military operations. Its speed and surprising strength make it excellent for skirmishing duties. Incursus-class ships move together in groups and can quickly and effectively gang up on ships many times their size and overwhelm them. In recent years the Incursus has increasingly found its way into the hands of pirates, who love its aggressive appearance.', '', '42', '0', '0', '0', '1', '8', '0', '0'), ('32137', '226', 'LCO Obelisk', 'The Obelisk was designed by the Federation in response to the Caldari State''s Charon freighter. Possessing similar characteristics but placing a greater emphasis on resilience, this massive juggernaut represents the latest, and arguably finest, step in Gallente transport technology.', '', '500', '11150000', '190000', '0', '1', '8', '0', '0'), ('32138', '517', 'Roineron Aviviere''s Iteron Mark III', 'An Iteron piloted by an agent.', '', '283', '0', '0', '0', '1', '8', '0', '0'), ('32139', '517', 'Mourmarie Mone''s Helios', 'The preservation of the Federation, its interests abroad, its culture and peoples, and the respect and pride in its traditions, are priority one for any true Gallente citizen. We are here to ensure that our way of life is not threatened, our livelihood is extant, and the freedom that we so love is available to every citizen. For this purpose, the freedom to enforce security is at our disposal.<br><br>- Mourmarie Mone, Constellation Director, Black Eagles ', '', '39', '1700000', '19700', '305', '1', '8', '0', '0'), ('32140', '517', 'Karde Romu ''s Armageddon', 'An Armageddon piloted by Karde Romu of the MIO.', '', '250', '0', '0', '0', '1', '4', '0', '0'), ('32189', '474', 'Shanty Town Gate Clearance', 'This gate clearance allows the user to unlock a specific acceleration gate.', '34_08', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32190', '705', 'The Elder', 'The Elder of the shanty town colony, and the representative of this group.', '', '150', '10900000', '109000', '120', '1', '2', '0', '0'), ('32192', '631', 'Underground Circus Ringmaster', 'The owner and operator of the Underground Circus.', '', '150', '11200000', '112000', '480', '1', '8', '0', '0'), ('32193', '283', 'The Ringmaster', 'A strong, lithe Jin-Mei, scantily clad and badly bruised. She refuses to take the feminine name of her position, preferring the masculine Ringmaster more disconcerting to authorities. Though defeated, she smiles constantly, her eyes burning with something akin to desire and yet, at the same time, cold, bitter hatred.', '46_08', '0', '50', '1', '0', '1', '0', '0', '0'), ('32194', '319', 'Gallente Starbase Control Tower Tough', 'Gallente Control Towers are more pleasing to the eye than they are strong or powerful. They have above average electronic countermeasures, average CPU output, and decent power output compared to towers from the other races, but are quite lacking in sophisticated defenses.', '', '3666', '100000', '1150', '8850', '1', '8', '0', '0'), ('32195', '517', 'Riff Hebian''s Armageddon', 'This battleship is commanded by Riff Hebian, head of Lord Miyan''s security forces.', '', '250', '0', '0', '0', '1', '4', '0', '0'), ('32196', '517', 'Krethar Mann''s Crusader', 'A vacationing Amarr noble.', '', '30', '0', '0', '0', '1', '4', '0', '0'), ('32198', '474', 'Destablizer Datacore', 'The Pator 6 stole this technology from Matari scientists and use it to keep outsiders away from their hideouts.', '64_02', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32199', '520', 'Scope Interceptor', 'An investigative reporter for the Scope.', '', '31', '2650000', '26500', '140', '1', '8', '0', '0'), ('32200', '314', 'Covert Recording Device', 'When planted in the mainframe of any structure, this device will record all communications, no matter how encrypted they may be.', '41_01', '0', '1', '1', '0', '1', '0', '58624', '0'), ('32201', '314', 'Archives Passkey', 'These electronic devices are commonly used as long-range digital passkeys, allowing access to secure facilities directly from space.', '55_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32202', '314', 'Hauteker Memoirs', 'Painstakingly written by hand in an antiquated Nefantar script, these memoirs outline the short-lived fortunes of an Ammatar clan known as the Hauteker  long since lost to time. The memoirs focus seems to be on the preservation of family tradition; the highly detailed passages document everything from the way the Hauteker family dressed to where they were all buried.', '50_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32204', '314', 'Wildfire Khumaak', 'This fragile Khumaak appears to be over a century old, and could perhaps date back to the Starkmanir rebellion itself. <br><br>There are unique markings along the side; tiny holes that appear to have fastened the scepter to a wall at one point. In the centre of the flared orb there is another unique distinguishing mark, the visage of an Amarrian man draped in the robes of a Saint. His name, Torus Arzad, is not mentioned in any contemporary history, Amarrian or otherwise. Below his face a single line of text reads:<br><br>Understand His mercy, and you will know enough.\r\n', '39_14', '0', '2', '0.3', '0', '1', '0', '10000', '0'), ('32205', '306', 'Central Burial Tomb', 'This shrine entombs someone of significant standing within the Hauteker family, most likely one of their last leaders before the bloodline vanished into obscurity.', '', '14', '10000', '27500', '2700', '1', '0', '0', '0'), ('32206', '952', 'Defiants Storage Facility', 'Storage warehouses like this are a common sight in space, and are employed by all kinds of people for all kinds of reasons. From storing wheat for Empire colonies to hiding vast stockpiles of drugs for resale, storage facilities serve a number of roles and as a result they are one of the most frequently deployed structures.', '', '1255', '100000', '27500', '2700', '1', '0', '0', '0'), ('32207', '324', 'Freki', 'Developed along with the first wave of Minmatar assault ships but later abandoned due to cost, the Freki is known for its extremely well designed warp core that enables it to arrive first on the scene to snare and eliminate its target.\r\n\r\nIt is rarely seen on the battlefield, as only a limited number have ever gone into production. It is usually given to pilots as a reward for their excellence in combat.\r\n\r\nSpecial Ability: 50% Small Projectile Turret falloff and optimal range bonus and 75% afterburner and microwarpdrive capacitor consumption bonus.\r\n\r\nMinmatar Frigate Skill Bonus: 12.5% Small Projectile Turret damage and 30% bonus to Stasis Webifier Range per level.', '', '31', '1309000', '27289', '165', '1', '2', '2736370', '1366');
INSERT IGNORE INTO `kb3_invtypes` VALUES('32208', '105', 'Freki Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '1500000', '0'), ('32209', '358', 'Mimir', 'A highly experimental prototype created by Minmatar scientists, intended to combine the qualities of their front line heavy assault ships. Heavily plated and sporting additional thrusters, this ship is not to be taken lightly.\r\n\r\nRarely seen these days, the ship is typically given out only to select pilots as a reward for their excellence in combat.\r\n\r\nSpecial Ability: 25% bonus to max velocity, 50% bonus to Medium Projectile Turret falloff and optimal range.\r\n\r\nMinmatar Cruiser Skill Bonus: 20% bonus to Medium Projectile Turret damage and 5% bonus to all armor resistances per level.', '', '89', '11650000', '96000', '450', '1', '2', '6875000', '1370'), ('32210', '106', 'Mimir Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '68750000', '0'), ('32211', '306', 'Archives', 'Archival facilities can sometimes be found dotted around the spacelanes of New Eden. Although it is rare for them to be established out here, it is not unknown for various companies and individuals to store valuable documents in such places. Some are motivated by logistical factors; its always easier to move things from system to system when theyre already in space. Others simply favor the privacy and security that endless kilometers of darkness and vacuum offers. ', '26_11', '14', '10000', '27500', '2700', '1', '0', '0', '0'), ('32216', '226', 'LCO Amarr Cathedral', 'This impressive structure operates as a place for religious practice and the throne of a high ranking member within the clergy.', '', '2787', '0', '0', '0', '1', '0', '0', '0'), ('32217', '306', 'Damaged Radio Telescope', 'Communications Array', '', '14', '10000', '27500', '2700', '1', '0', '0', '0'), ('32218', '314', 'Encrypted Data Fragment', 'This data node guards its secrets with a powerful encryption cipher. The unique design of the encryption is clearly proprietary and not something used elsewhere. The security software driving the protection represents a strange mixture of Gallente and Caldari designs. ', '34_05', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32219', '319', 'Pator 6 HQ', 'A decrepit wreck of a structure, the HQ for the Pator 6 is full of junk, debris, and rubble. Childrens clothes are strewn throughout the headquarters. This gang may be behind more kidnappings and human trafficking cases than at first glance.', '', '10966', '0', '0', '0', '1', '0', '0', '0'), ('32220', '314', 'Ralie Ardannes Belongings', 'Though only a teenager, Ralie Ardanne has quite a few endorsement deals with major clothing labels. This jacket is part of his signature look. Based on your file on him, you know that Ralie goes nowhere without his jacket. The bloodstains and other marks on the fabric do not bode well, but at least this will provide evidence that the authorities can track.', '56_09', '0', '1', '1', '0', '1', '0', '0', '0'), ('32221', '319', 'Scope Station', 'One of Scopes satellite stations in the area.', '', '8651', '0', '0', '0', '1', '8', '0', '0'), ('32222', '520', 'Mourmarie Mones Covert Ops Frigate', 'Mourmarie Mone, Constellation Director, Black Eagles.', '', '31', '2650000', '26500', '140', '1', '8', '0', '0'), ('32223', '314', 'Kidnapping Evidence', 'Veine Coructie has collected the evidence you collected from the Pator 6, as well as some of the data found from the bug you planted. With this in hand, theyre ready to smoke the kid out by causing a big media stir. Theres no hiding when an entire population is out to get you. Sure, you should probably take this to the FIO, but who knows how effective this will be?', '64_04', '0', '0.75', '0.1', '0', '1', '0', '0', '0'), ('32224', '952', 'Conference Center', 'The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.', '', '379', '10000', '27500', '2700', '1', '0', '0', '0'), ('32225', '314', 'Encoded Message', 'This message is encoded in a familiar hybrid cipher. Only those who are already in the know about the arrangements in Black Rise will be able to make sense of it.', '10_16', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32226', '1003', 'Territorial Claim Unit', 'This unit contains a large fluid router array. By establishing an alternate data route to CONCORD networks, it grants de-facto administrative control of the system it''s in to its owners.\r\n\r\nOnce online, it installs defensive protocols into the local data net which cause targeting systems to consider it an invalid target. The only way to remove this structure once it is established is to seed override protocols into more than half of the stargates in a system simultaneously. This is done by using Sovereignty Blockade Units.', '', '1602', '1000000', '5000', '0', '1', '0', '100000000', '1273'), ('32228', '283', 'Vira Mikano', 'Although looking slightly shaken, this Deteis man appears calm and resigned to his fate. Said to be one of Ishukone Watchs best cryptographers, Mikano represents everything that is admired about the Watch; efficiency, loyalty and honor. There would be severe repercussions for anyone found responsible for his disappearance.', '46_03', '0', '85', '3', '0', '1', '0', '0', '0'), ('32229', '314', 'Singed Datapad', 'This barely-functioning piece of personal electronics turns out to contain ledger upon ledger of financial statements, high-level meeting transcripts and company rosters from several public and private Minmatar organizations. A large portion of the data is encoded in some sort of advanced cipher, leaving it completely unintelligible.', '26_04', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32230', '875', 'Republic Freighter Vessels', 'The large navy forces of the Empires regularly use freighters to transport a wide variety of military items and personnel en masse. Such vulnerable ships are usually heavily guarded as they traverse the space lanes.', '', '700', '1025000000', '15500000', '720000', '1', '2', '0', '0'), ('32233', '306', 'Tili''s Brothel', 'The architectural design for the CreoDron Habitation Module started out as a contract deal from the Expert Housing Corporation to standardize the modular drifter homes normally used by miners and deep space explorers. When the project was cancelled due to insufficient funding, CreoDron utilized their design for the open market as high-orbit department buildings for commercial use. The marketing was a tremendous hit, making the Habitation Module a common sight across the universe. Common uses include anything from bars, casinos and brothels, to police stations and interrogation facilities.', '', '379', '100000', '100000000', '10000', '1', '0', '0', '0'), ('32234', '314', 'Encrypted Transmission', 'This is an encrypted transmission from the RSS agent''s Ammatar spy. It is a wholly incomprehensible string of 1s and 0s.', '34_05', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32235', '314', 'Tattered Doll', 'Formerly belonging to a young child, this doll has been through rough times. Tattered and worn, the synthetic material is stained with odd markings, presumably blood or tears from the dolls former owner.', '56_10', '0', '10', '3', '0', '1', '0', '0', '0'), ('32237', '314', 'Octomet Dog Tags', 'These dog tags are crudely constructed and chipped at the edges. The words are scrawled across the metal in a rough fashion, which feel hasty in their inscription. The name on the dog tag appears to be Caldari, though it is difficult to tell. A serial number also appears, as well as the acronym D-IDS/IS.', '34_08', '0', '10', '3', '0', '1', '0', '0', '0'), ('32238', '319', 'Biodome', 'This biodome is used for cultivation of plants and animals alike.', '', '4974', '100000', '100000000', '10000', '1', '8', '0', '0'), ('32239', '319', 'Gallentean Deadspace Mansion', 'Though not quite large enough to be a station, this ornate, lavish establishment contains furnishings for any multi-purpose deadspace location. From cutting edge laboratories, to private studios and entertainment facilities, the services available in this structure are applicable for professionals and elite socialites alike.', '', '918', '100000', '100000000', '10000', '1', '8', '0', '0'), ('32240', '306', 'Data Bank', 'If you have the right equipment you might be able to hack into the databank and get some valuable information.', '', '834', '10000', '27500', '2700', '1', '0', '0', '0'), ('32241', '314', 'Drive Cluster EDF-285', 'This is a cluster of drives, each of which contains several exabytes worth of encoded data. Somewhere in here is vital information on the Wildfire Khumaak.', '24_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32242', '474', 'Carry On Token', 'This item appears to be either a medal or a token of some kind. Either way, its shiny.', '30_09', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32243', '517', 'Cosmos Rapier', 'A Rapier piloted by an agent.', '', '109', '0', '0', '0', '1', '2', '0', '0'), ('32244', '517', 'Nilf Abruskur''s Rapier', 'A Rapier piloted by an agent.', '', '109', '0', '0', '0', '1', '2', '0', '0'), ('32245', '413', 'Hyasyoda Mobile Laboratory', 'Portable laboratory facilities, anchorable within control tower fields.\r\n\r\nThis structure has:\r\n\r\n4 ME slots (0.75 job time bonus)\r\n4 PE slots (0.75 job time bonus)\r\n6 Invention slots (0.5 job time bonus)', '', '782', '1000000', '3000', '25000', '1', '0', '100000000', '0'), ('32246', '479', 'RSS Core Scanner Probe', 'This is the first of a new generation of multi-mode scanning probes. Designed to provide an all-in-one reconfigurable scanning package, this compact tool meets the needs of the core scanning market in a single, flexible product.\r\n\r\nHowever, size limitations mean that this probe does not include the advanced circuitry needed to scan down ships, drones and structures.', '27_09', '1', '1', '0.1', '0', '1', '0', '4236', '1199'), ('32248', '303', 'Nugoehuvi Synth Blue Pill Booster', 'This booster relaxes a pilot''s ability to control certain shield functions, among other things. It creates a temporary feeling of euphoria that counteracts the unpleasantness inherent in activating shield boosters, and permits the pilot to force the boosters to better performance without suffering undue pain.', '62_06', '1', '1', '1', '0', '1', '0', '8192', '0'), ('32250', '1005', 'Sovereignty Blockade Unit', 'This computing unit will interface with any nearby stargate, and attempt to restore default operating protocols to it. This process takes three hours to accomplish, and will only succeed when more than half the stargates in the system have been overriden in this manner.\r\n\r\nOnce a successful override has been made, any infrastructure hubs and outposts will become vulnerable.', '', '243', '1000000', '2500', '0', '1', '0', '250000000', '1274'), ('32252', '314', 'Amphere 9', 'A synthetic drug long banned by the Empires, Amphere 9 can still be found in the border regions and outlawed territories of New Eden. The drug contains bits of nitrazepam, amphetamine, sodium pentothal, and synthetically rendered dopamine, plus a number of other potentially lethal substances. <br><br>\r\n\r\nThere is still a thriving black market for the pill, which many consider to be a dirtier version of Vitoc, keeping workers sedate and stable yet remarkably open to suggestion by others. The drug is especially effective on children under the age of twelve with no serious physical side effects, though no conclusive medical study has been conducted to support this claim.', '11_14', '0', '10', '1', '0', '1', '0', '0', '0'), ('32253', '314', 'Counterfeit Minmatar Faction Ammo', 'Crafted in illicit child labor factories, this counterfeit ammo is designed to mirror the ammo utilized in the Minmatar Navy in look, feel, and power. Because of its black market creation, though, the ammo is highly unstable, and not suitable for use in any ship. Black marketers make a modest fortune selling this ammo to unsuspecting customers with no eye for high-powered munitions.', '14_11', '0', '10', '2.5', '0', '1', '0', '0', '0'), ('32254', '738', 'Imperial Navy Modified ''Noble'' Implant', 'A neural Interface upgrade that boosts the pilot''s skill at maintaining his ship''s midlevel defences and analyzing and repairing starship damage. Grants a +3% Bonus to armor hit points and +3% bonus to repair system Repair amount.', '40_16', '1', '0', '1', '0', '1', '0', '200000', '0'), ('32255', '749', 'Sansha Modified ''Gnome'' Implant', 'Improved skill at regulating shield capacity and recharge rate. 3% Bonus to shield capacity and 3% bonus to shield recharge rate.', '40_16', '1', '0', '1', '0', '1', '0', '200000', '0'), ('32256', '306', 'RSS Radio Telescope', 'Communications Array', '', '14', '10000', '27500', '2700', '1', '0', '0', '0'), ('32257', '314', 'Report R:081-9560', 'This data fragment was pulled from an RSS Radio Telescope. It appears to be just one part of a larger intelligence dossier. <br><br>The Consulate is able to, of course, but Im confident that the current situation wont escalate. Even still, we need to keep pushing for the location of the [unidentified encryption  string undecipherable]  the Angels have smelled Jovian involvement and are now throwing all kinds of ISK around to catch up to us. They will, eventually. Dont doubt it. I almost wish Boufin sold us out to them in the end, theyd realize there is nothing of value to them there and screw off. But then I guess anything we value, theyll want to lord over us too. Ive noticed a few people of theirs are assigned to me too. Ill be taking slightly longer to get to our meetings as a result; I dont want to be leading them anywhere we dont want. <br><br>She asked to meet Boufin again today by the way, and again I had to explain the risks and make her promise to lie low. Im not completely trusting that she will let me handle things. She needs to keep up her public appearances in court, not go off meeting Gallentean historians in secret. Her career would be over in a second if we got made, and Id have serious problems of my own. <br><br>Shes growing increasingly frustrated though, so we may have to look into some kind of arrangement. Surely we can set up a secure FTL line for them both? I know how to do it myself; I just need your clearance to proceed.', '53_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32258', '314', 'Report R:081-9568', 'This data fragment was pulled from an RSS Radio Telescope. It appears to be just one part of a larger communication. The intended recipient is unknown, but is presumably someone within the upper echelons of the Republic Security Services. <br><br>you dare try and cut me out of the loop again. If you wanted to run operations without me knowing or caring then you shouldve brought in someone with half my skill. <br><br>Ive given six years of my life to this. Try that shit again and Ill be out of here. The last thing youll see before the sip of Pator Whiskey you keep in the 2nd drawer kills you will be me waving a Wildfire Khumaak on The Scope news.', '53_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32259', '314', 'Operation Stillwater: Synopsis', 'This small data storage unit contains a swathe of operational information, offering insights into an ongoing RSS investigation known as Stillwater. <br><br>Although the report logs number in the hundreds of pages, a few key details become immediately apparent. The name of a highly-ranked Ammatar Consulate official recurs frequently, and references to her as sister reveal a secret loyalty to the Republic. Despite the prominence of this Ammatar defector in the reports, her name and any other identifying details have been omitted. <br><br>Page after page of the synopsis is filled with meticulous documentation of the agents daily life; every meeting they had, every stakeout they sat through, and every other lead they chased up  it is all here. The problem isnt the lack of detail, more the overwhelming amount of it. It will take some time to make sense of it all.\r\n', '53_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32260', '330', 'Syndicate Cloaking Device', 'This prototype of an advanced cloaking mechanism was one of the last major technological breakthroughs to come out of Crielere Labs. Although it does work it is not really a finished product and has some serious drawbacks, most notably the fact that the module creates high sensor disruption while fitted and can not operate unless at minimum velocity.\r\n\r\nNote: Fitting two or more cloaking devices to a ship negates their use, as unsynchronized light deflection causes interference.', '35_12', '0', '0', '100', '0', '1', '0', '802680', '0'), ('32262', '647', 'Black Eagle Drone Link Augmentor', 'Increases drone control range.', '56_07', '100', '200', '25', '0', '1', '0', '213360', '0'), ('32264', '319', 'Warp Core Hotel', 'Formerly an old armory, this building has been refurbished to accommodate weary travelers for a peaceful nights rest, or at least a temporary reprieve while on the jump between systems. The accommodations are efficient, designed to maintain a steady stream of customers. The rooms are sparse, the staff light, and the entire structure is rather unkempt. An odd smell permeates the walls, and most everything operates by ISK-slots. Older men and women loom around the lobby. Their attire would be provocative if they werent so haggard and worn, though they always seem ready for a good time.<br><BR>\r\n\r\nWarp Core Hotel: Hourly rates only', '', '700', '100000', '100000000', '10000', '1', '1', '0', '0'), ('32265', '314', 'Spintric Coin', 'A curious feature of The Spintrix is their admission system. The men and women working at this establishment do not accept ISK or any other sort of planetary currency. Rather, these workers accept only Spintrix coins, specially designed and highly desirable copper coins purchased through the agents of the Spintrixs owners.', '56_12', '0', '10', '1', '0', '1', '0', '0', '0'), ('32266', '314', 'Spintrixiate Rewards Coin', 'Special customers to the Spintrix are often rewarded with this unique coin, dubbed the Spintrixiate. Little is known about the benefits of this rewards token, though rumors among former clients circulate that the coin allows access to the mysterious Room B.', '02_16', '0', '10', '1', '0', '1', '0', '0', '0'), ('32267', '314', 'Ishukone Operational Reports', 'Bluechip devices like these serve a similar role to the "black boxes" used aboard planetary aircraft. They are capable of storing vast amounts of information, and protecting it in a secure shell that can withstand immense destructive forces. Due to their resilience, they are also the favored data storage unit of military companies who need vital operational data to be safeguarded from attack. <br><br>\r\n\r\nThis particular bluechip has been modified to protect the contents in even more ways. A distinctively unique hybrid cipher has reduced the contents of each report to a series of 1''s and 0''s. \r\n', '55_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32268', '667', 'Harkans Behemoth', 'Lord Harkans ship is an impressive example of Amarr engineering. It appears after his retirement his ship was refit with cobalt-plated armor. It is unclear if this was a personal decision or the sign of an even darker alliance.', '', '250', '20500000', '1100000', '525', '1', '4', '0', '0'), ('32269', '668', 'Lord Miyan', 'Lord Miyans cruiser is packed with the latest Amarr technology. Still not advanced enough to stop the guns of a capsuleer.', '', '150', '11800000', '118000', '235', '1', '4', '0', '0'), ('32270', '283', 'Artificial Miyan', 'This amalgamation of Amarr and Sansha technology is the spitting image of Lord Miyan. Once activated it could fool anyone into believe it was the real, living Holder.', '46_03', '0', '90', '2', '0', '1', '0', '0', '0'), ('32271', '952', 'Business Associate', 'Business Associate.', '', '400', '13500000', '27500', '2700', '1', '4', '0', '0'), ('32272', '314', 'Primordial Biomass', 'This vat of biomass is slightly soupier than most.', '25_15', '0', '1', '1', '0', '1', '0', '0', '0'), ('32273', '952', 'Safe House Ruins', 'This structure has seen better days.', '', '22578', '10000', '27500', '2700', '1', '0', '0', '0'), ('32275', '226', 'LCO Amarr Chapel', 'This decorated structure serves as a place for religious practice.', '', '800', '0', '0', '0', '1', '0', '0', '0'), ('32276', '306', 'Office Facility', 'These small compounds can house hundreds of office workers, and are typically used as a cost-efficient temporary solution for large corporations moving their workforce between stations. ', '', '14', '100000', '27500', '2700', '1', '0', '0', '0'), ('32277', '314', 'Deteis Family', 'A normal, if somewhat familiar-looking Deteis family. ', '11_12', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32278', '517', 'Hiva Shesha''s Shuttle', 'The sands of time is a complex metaphor, and as historians, we must understand its meaning. We are not here to play in a sandbox and find all the hidden rocks. History is not the unraveling of truth or unearthing forgotten knowledge. Rather, the sands of time are mixed with our rational minds to form glass. We are opticians, further carving that glass into lenses, which are layered together. Sometimes the view becomes clearer; other times, opaque. We cannot change the sands of time: We can only sharpen our lenses.<Br><Br>-Hiva Sheesha, <i>A History of the Matari People</i>', '', '39', '0', '0', '0', '1', '2', '0', '0'), ('32279', '306', 'Chapel of the Obsidian', 'Chapel of the Obsidian', '', '314', '10000', '27500', '2700', '1', '0', '0', '0'), ('32280', '314', 'Blood Obsidian Orb', 'The Church of the Obsidian has kept this relic for nearly four hundred years, though its original meaning was never truly discovered. The orb is carved from blood obsidian, the same material found in the head of the Wildfire Khumaak. The orbs surface is completely smooth, though it is lighter than it appears. ', '35_02', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32281', '306', 'Secure Communications Tower', 'This huge communications tower contains fragile but advanced sensory equipment.', '', '2636', '100000', '27500', '2700', '1', '0', '0', '0'), ('32282', '306', 'Ammatar Relics', 'This massive hulk of debris seems to have once been a part of the outer hull of a battleship or station.', '', '314', '10000', '27500', '2700', '1', '0', '0', '0'), ('32283', '314', 'Engraved Blood Obsidian tablet', 'A small tablet, made entirely of blood obsidian, engraved with writing. The words on the tablet are not entirely clear, and the dialect is familiar, though unreadable. ', '35_02', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32284', '314', 'St. Arzad', 'A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 1  St. Arzad reads as follows:<br><br>\r\nAnd so it was that Arzad Hamri, son of Ezzara Hamri, grandson of Yuzier Hamri, ascended to the title of Holder of the most holy grounds on Starkman Prime. Though only a young man, Arzad held the wisdom of the ages, granted to him by the celestial Maker, and carried with him the burden of creation. <br><br>\r\nHis first act as Holder was to grant a day of celebration to all his slaves, calling that day holy by the Amarr religion. The slaves, members of the Starkmanir tribe, referred to that day as the Hand of Solace or Khu-arzad. Unlike his father before him, Arzad was instantly loved by his slaves, and his benevolence sowed the seeds of righteous love between Holder and slave.\r\n', '55_12', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32285', '314', 'The Benevolent', 'A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 6  The Benevolent reads as follows:<br><br>\r\nThe fields and hills of Starkman Prime are harsh and demanding, especially for those working indentured servants tied directly to the land by the holy bonds of slavery. Arzad Hamri understood their plight and pitied them. As a boy, he would often work alongside the Starkmanir in the fields, immersing himself with the tribe to better understand their customs and traditions, much to the chagrin of his father and elders. <br><br>\r\nAs a Holder, Arzad offered many forms of restitution and bereavement for the Starkmanir during their often long and difficult days. Regular rest periods were common during his rule, as well as days of parlay and rest, including high holy days and other Amarr religious festivals, deeming these occasions to be too holy. The Starkmanir loved him for these decisions, often working extra hours when necessary because they respected Arzad and wished for him to be pleased with their efforts.\r\n', '55_12', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32286', '314', 'The Education of the Starkmanir', 'A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 12  The Education of the Starkmanir reads as follows:<br><br>\r\nBy the end of his tenth year as Holder on Starkman Prime, Arzad had finished the educational infrastructure for the Starkmanir with the establishment of the final slave college on his continent. The focus of these education centers, aimed at young members of the Starkmanir tribes, was in assimilating the slaves into the greater Amarr society. The focus was primarily in basic business matters, science and technology, and all aspects of the Amarr religion. Attendance at this school was not entirely elective, and slaves were given time to study, though they would often have to make up for lost time in the fields. Despite this, many Starkmanir entered into the slave colleges in order to better their station in life, especially with respect to the high, holy Amarr religion.<br><Br>\r\nThe Starkmanir also educated their beloved Holder in kind, as well as other members of the Hamri family. The tradeoff in education was often mutual between the tribal leaders and Arzad. When the slave colleges began teaching business matters, the Holder learned ancient Starkmanir woodworking; astronomy education led to the Starkmanir martial arts; and the teaching of the Amarr religion initiated Arzads own edification of the Starkmanirs tribal spiritualism.\r\n', '55_12', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32287', '314', 'Hand of Arzad', 'A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 20  Hand of Arzad reads as follows:<br><br>\r\nThe Hand of Arzad grew to become the most popular festival on Starkman Prime, so beloved was this day of rest granted by Arzad Hamri. On this day, Hamri presided acted as pastor of religious services, in which most of the Starkmanir attended. His sermons from these festivals were collected and distributed among the tribe, often used by the elders to educate the young people of the importance of benevolence and good grace to people of all stations. <br><br>\r\nThe theme of Arzads sermons was almost always of the inherent dignity of the Starkmanir, their precious qualities, and the hope of salvation through servitude. This message did not fall on deaf ears, and many ambitious, young Starkmanir took his words as inspiration for independence and rebellion against the greater Amarr Empire, though Arzad was always able to quell the burgeoning pride and self-esteem of the slaves. Salvation comes through servitude, the grace of your masters, the dignity of your being, was Arzads common response, his refrain found throughout his sermons. \r\n', '55_12', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32288', '314', 'The Fire in Our Hearts', 'A tattered document, presumably a part of a larger manuscript. The text is written neatly, though much of it is faded. An excerpt from this piece, titled Chapter 37  The Fire in Our Hearts reads as follows:<br><br>\r\nLord Arkon Ardishapur, though a longtime friend of Arzad, oversaw the popular Holders execution for treason and blasphemy. Arzad had requisitioned an Amarr symbol of authority, a scepter, as a symbol for lowly slaves. Arzads granted the scepter to his slaves as a symbol for enlightenment and salvation. Ardishapur ordered that all copies of this scepter  dubbed Wildfire scepters for its blood obsidian orb, a rock native to Starkman Prime  be destroyed. The Starkmanir were angry at his execution. Arzads book of sermons inspired the troubled tribe. <br><br>\r\nThree months after his death, Arzad appeared to Drupar Maak while the slave was alone in the fields. The Starkmanir youth was afraid at first, though once he saw the shimmering eyes of his former Holder, he was at peace. Arzad handed a Wildfire scepter to Maak, telling him, The fire in our hearts burns for salvation, redemption, and grace. May the Word of God grant you the courage to save yourself and your people. With those words, Arzad disappeared, but the scepter was still with Maak. Years later, he would wield a similar item and avenge the death of his beloved Holder on the day of Khu-arzad. After that day, the scepter would be forever known as Khumaak.\r\n', '55_12', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32289', '314', 'Holoreel: Wanted for Love', 'A low-quality holoreel titled Wanted for Love. The description on the back of the shoddy packaging reads: <br><br>\r\n\r\nA Gallente women, recently divorced and fired from her high-paying job at Combined Harvest, is framed for murdering her ex-husband. On the run from CONCORD, she delves deep into the heart of New Edens underworld, where she discovers what shes truly made of. Hot on her trails is her ex-lover, a deputy officer in the Directive Enforcement Department. Inspired by love, he goes undercover in search of his one and only soulmate, who is truly wanted for love. This sultry, uncensored journey of self-discovery and the limits of romance stimulates mind, body, and soul. Starring Elois Ottin in her most scintillating performance yet.', '10_05', '0', '10', '1', '0', '1', '0', '0', '0'), ('32290', '314', 'Obsidian Datacore', 'Found inside the Blood Obsidian Orb, this datacore is supposed to reveal the location of the lost <i>Book of St. Arzad</i>.', '55_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32291', '952', 'Chapel Container', 'This decorated structure serves as a place for religious practice.', '', '14', '10000', '27500', '2700', '1', '0', '0', '0'), ('32292', '283', 'Ralie Ardanne', 'Battered, bruised, worn, but ultimately alive. Ralie sits there, staring straight in front of him, his eyes glazed over. The kids alive, but who knows how long he will be recovering from these scars.', '46_01', '0', '60', '1', '0', '1', '0', '0', '0'), ('32293', '706', 'Rosulf Fririk', 'This variant of the frontline battleship of the Minmatar Republic has been heavily modified with only one purpose in mind: Destruction. It has been supplemented with decks of top-of the-line-fire control systems, and its entire power distribution structure has been redesigned to provide as much power as possible to its weapons, resulting in a truly fearsome battleship.', '', '250', '19000000', '850000', '550', '1', '2', '0', '0'), ('32294', '314', 'Book of St. Arzad', 'This book is in tatters, and some of its page are worn or missing, but much of its contents is still readable. The book describes the life of Arzad Hamri, an Amarr Holder on Starkman Prime. It is supposedly a relic from the Starkmanir Rebellion.', '50_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32296', '674', 'Ishukone Watch Commander', 'In every Ishukone Watch base there is a single Commander who oversees operations. The men and women selected for this honored duty represent the most capable military minds outside of the Caldari Navy. The service records of these Commanders typically show a long and distinguished career fighting against the many threats facing their parent Corporation, and often the Caldari people as a whole. It is not uncommon for people in such positions to rise into minor celebrity status, as their deeds grant them a glimpse of the almost mythological status held by the State''s great military names.', '', '350', '1080000', '22000000', '235', '1', '1', '0', '0'), ('32297', '674', 'Nugoeihuvi Caretaker', 'Those who watch over Nugoeihuvi''s secret storage facilities are entrusted with secrets that run deep inside the shadowed histories of the NOH staff. Valued for their loyalty, discretion and endless hunger for ISK, these men and women serve Nugoeihuvi''s darkest interests without question.', '', '350', '1080000', '22000000', '235', '1', '1', '0', '0'), ('32298', '594', 'Karkoti Rend', 'A rogue RSS agent, working for the Cartel.', '', '350', '19000000', '19000000', '120', '1', '2', '0', '0'), ('32299', '952', 'Senator Pillius Ardanne', 'Senators Viator.', '', '400', '13500000', '27500', '2700', '1', '4', '0', '0'), ('32300', '1003', 'TEST Territorial Claim Unit', 'This unit contains a large fluid router array. By establishing an alternate data route to CONCORD networks, it grants de-facto administrative control of the system it''s in to its owners.\r\n\r\nOnce online, it installs defensive protocols into the local data net which cause targeting systems to consider it an invalid target. The only way to remove this structure once it is established is to seed override protocols into more than half of the stargates in a system simultaneously. This is done by using Sovereignty Blockade Units.', '', '1602', '65000', '300', '10', '1', '0', '100000000', '0'), ('32301', '841', 'TEST Territorial Claim Unit Blueprint', '', '06_03', '0', '0', '0.01', '0', '1', '0', '0', '0'), ('32302', '1005', 'TEST Sovereignty Blockade Unit', 'This computing unit will interface with any nearby stargate, and attempt to restore default operating protocols to it. This process takes six hours to accomplish, and will only succeed when more than half the stargates in the system have been overriden in this manner.\r\n\r\nOnce a successful override has been made, any infrastructure hubs and outposts will become vulnerable.', '', '243', '32000', '90', '10', '1', '0', '250000000', '0'), ('32303', '841', 'TEST Territorial Disruption Unit Blueprint', '', '06_03', '0', '0', '0.01', '0', '1', '0', '0', '0'), ('32304', '517', 'Harkan''s Apocalypse', 'An Apocalypse piloted by an agent.', '', '400', '0', '0', '0', '1', '4', '0', '0'), ('32305', '27', 'Armageddon Navy Issue', 'An improved version of the feared Armageddon-class battleship, this vessel is probably one of the deadliest war machines ever built by the hand of man. Commanding one is among the greatest honors one can attain in the Amarr Empire, and suffering the fury of its turret batteries is surely the fastest way to reunite with the void.<br><br>\r\nAmarr Battleship Skill Bonus: 10% bonus to Large Energy Turret capacitor use and 5% Large Energy Turret rate of fire per level.', '', '250', '105200000', '486000', '600', '1', '4', '66250000', '1379'), ('32306', '107', 'Armageddon Navy Issue Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '662500000', '0'), ('32307', '27', 'Dominix Navy Issue', 'The Dominix Navy Issue''s past is prominently interwoven with history, as it is known to have directly participated in the blockade and bombardment of Caldari Prime along with the Dracofeu orbital-class bomber two centuries ago. Engineered for capsule compliance, and refitted to serve more traditional combat roles, the Dominix Navy Issue today remains an extremely effective vessel and an invaluable asset in close- to mid-range battle situations.<br><br>Gallente Battleship Skill Bonus: 5% bonus to Large Hybrid Turret damage and 10% bonus to drone hitpoints and damage per skill level.', '', '250', '97100000', '454500', '600', '1', '8', '62500000', '1379'), ('32308', '107', 'Dominix Navy Issue Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '625000000', '0'), ('32309', '27', 'Scorpion Navy Issue', 'This ship''s design represents a radical turnaround in Caldari philosophy, particularly when compared to that of its regular Scorpion-class counterpart. Abandoning the concept of an electronic warfare platform, this vessel''s creators instead set their sights on direct combat, with superior shielding and offensive capabilities giving this monster the undeniable upper hand in a vast range of tactical situations.<br><br>Caldari Battleship Skill Bonus: 5% bonus to Cruise and Siege Launcher Rate Of Fire and 5% shield resistance per level', '', '250', '103600000', '468000', '550', '1', '1', '71250000', '1379'), ('32310', '107', 'Scorpion Navy Issue Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '712500000', '0'), ('32311', '27', 'Typhoon Fleet Issue', 'Possibly the most versatile vessel in New Eden, the Typhoon Fleet Issue is a true wonder in design adaptability. Boasting improved fittings, speed and weapon hardpoints over its standard counterpart, this ship is widely known as an invaluable wild card in any small-scale engagement.<br><br>Minmatar Battleship Skill Bonus: 5% bonus to Large Projectile Turret Rate of Fire and 5% bonus to Siege and Cruise missile launcher Rate of Fire per level', '', '250', '103600000', '414000', '625', '1', '2', '75000000', '1379'), ('32312', '107', 'Typhoon Fleet Issue Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '750000000', '0'), ('32313', '1012', 'Test Infrastructure Hub', 'An Infrastructure Hub is the cornerstone of any empires expansion into nullsec territory.\r\n\r\nOnce online, it allows the owner to cultivate the system it is placed in by applying one of the upgrades available. These upgrades range from simple improvements to a systems financial infrastructure, to defensive upgrades giving the system owner significant advantages.\r\n\r\nAs an added bonus, the Infrastructure Hub functions as a defensive structure as well, as sovereignty cannot be taken while it is still online.', '', '10290', '100', '80', '110', '1', '0', '40', '0'), ('32314', '1004', 'Test Defense Bunker', 'MATT make description for this!', '', '3394', '100', '80', '110', '1', '4', '1020480', '0'), ('32325', '1023', 'Cyclops', 'Gallente Fighter Bomber Craft', '', '35', '12000', '5000', '0', '1', '8', '26743700', '1310'), ('32326', '176', 'Cyclops Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '300000000', '1313'), ('32339', '273', 'Fighter Bombers', 'Allows operation of fighter bomber craft. 20% increase in fighter bomber damage per level.', '50_11', '0', '0', '0.01', '0', '1', '0', '100000000', '366'), ('32340', '1023', 'Malleus', 'Amarr Fighter Bomber Craft', '', '35', '12000', '5000', '0', '1', '4', '25060500', '1310'), ('32341', '176', 'Malleus Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '300000000', '1313'), ('32342', '1023', 'Tyrfing', 'Minmatar Fighter Bomber Craft', '', '35', '12000', '5000', '0', '1', '2', '25007100', '1310'), ('32343', '176', 'Tyrfing Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '300000000', '1313'), ('32344', '1023', 'Mantis', 'Caldari Fighter Bomber Craft', '', '35', '12000', '5000', '0', '1', '1', '25425800', '1310'), ('32345', '176', 'Mantis Blueprint', '', '', '0', '0', '0.01', '0', '1', '0', '300000000', '1313'), ('32347', '306', 'Exploration Supplies', 'This storage facility contains a basic supply of exploration scanning equipment for use by capsuleers-in-training.', '', '1255', '10000', '27500', '2700', '1', '0', '0', '0'), ('32348', '927', 'Agent Rulie Isoryn', 'This ship poses no immediate threat.', '', '553', '11750000', '275000', '6000', '1', '8', '0', '0'), ('32349', '319', 'Proximity Charge', 'Standard mine with nuclear payload.', '', '120', '100000', '100000000', '10000', '1', '1', '0', '0'), ('32350', '314', 'Proof of Discovery: Anomalies', 'This document has been placed inside a Cosmic Anomaly secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the anomaly through the use of On-Board Scanning.', '07_03', '0', '1', '1', '0', '1', '0', '0', '0'), ('32351', '314', 'Proof of Discovery: Gravimetric', 'This document has been placed inside a Gravimetric site secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the signature through the use of Core Scanner Probes.', '07_03', '0', '1', '1', '0', '1', '0', '0', '0'), ('32352', '314', 'Proof of Discovery: Gravimetric Passkey', 'This electronic passkey is provided by tutorial agents as part of a capsuleer training program. It is used to unlock an acceleration gate inside the Gravimetric site training area, where the Proof of Discovery documents can be found stored inside containers. The Proof of Discovery documents serve as physical evidence that the capsuleer was able to discover a particular type of site. \r\n\r\nThis passkey is used to unlock Acceleration gates found inside <b>Gravimetric </b> sites only.', '34_06', '0', '1', '1', '0', '1', '0', '0', '0'), ('32353', '306', 'Training Container - Anomalies', 'This container houses the <b>Proof of Discovery: Anomalies</b> document, which serves as physical proof that a capsuleer-in-training has been able to locate the anomaly through the use of On-Board Scanning. It must be retrieved to complete the first tutorial mission. \r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.', '26_11', '14', '10000', '27500', '2700', '1', '0', '0', '0'), ('32357', '1010', 'Compact Doom Torpedo I', 'Representing the latest in miniaturization technology, Compact Citadel Torpedoes are designed specifically to be used by Fighter Bombers.\r\n\r\nNocxium atoms captured in morphite matrices form this missile''s devastating payload. A volley of these is able to completely obliterate most everything that floats in space, be it vehicle or structure.', '21_10', '300', '1500', '0.3', '0', '100', '0', '250000', '0'), ('32359', '1010', 'Compact Purgatory Torpedo I', 'Representing the latest in miniaturization technology, Compact Citadel Torpedoes are designed specifically to be used by Fighter Bombers.\r\n\r\nPlasma suspended in an electromagnetic field gives this torpedo the ability to deliver a flaming inferno of destruction, wreaking almost unimaginable havoc.', '21_06', '300', '1500', '0.3', '0', '100', '0', '325000', '0'), ('32361', '1010', 'Compact Rift Torpedo I', 'Representing the latest in miniaturization technology, Compact Citadel Torpedoes are designed specifically to be used by Fighter Bombers.\r\n\r\nFitted with a graviton pulse generator, this weapon causes massive damage as it overwhelms ships'' internal structures, tearing bulkheads and armor plating apart with frightening ease.', '21_02', '300', '1500', '0.3', '0', '100', '0', '300000', '0'), ('32363', '1010', 'Compact Thor Torpedo I', 'Representing the latest in miniaturization technology, Compact Citadel Torpedoes are designed specifically to be used by Fighter Bombers.\r\n\r\nNothing more than a baby nuclear warhead, this guided missile wreaks havoc with the delicate electronic systems aboard a starship. Specifically designed to damage shield systems, it is able to ravage heavily shielded targets in no time.', '21_14', '300', '1500', '0.3', '0', '100', '0', '350000', '0'), ('32365', '314', 'Proof of Discovery: Magnetometric', 'This document has been placed inside a Magnetometric site secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the signature and properly perform salvage and analysis inside the area.', '07_03', '0', '1', '1', '0', '1', '0', '0', '0'), ('32366', '314', 'Proof of Discovery: Radar', 'This document has been placed inside a Radar site secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the signature and successfully perform a hacking attempt inside the area.', '07_03', '0', '1', '1', '0', '1', '0', '0', '0'), ('32367', '306', 'Training Container - Archeology', 'This container must be accessed using a <b>Civilian Analyzer</b>. As soon as a successful salvage attempt is detected, it will unlock. Inside, the <b>Proof of Discovery: Magnetometric</b> document can be retrieved.\r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.', '26_11', '314', '10000', '27500', '2700', '1', '0', '0', '0'), ('32368', '306', 'Training Container - Salvaging', 'This container must be accessed using a <b>Civilian Salvager</b>. As soon as a successful salvage attempt is detected, it will unlock. Inside, the <b>Proof of Discovery: Magnetometric</b> document can be retrieved.\r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.', '26_11', '14', '10000', '27500', '2700', '1', '0', '0', '0'), ('32369', '306', 'Training Container - Radar', 'This container must be accessed using a <b>Civilian Codebreaker</b>. As soon as a successful hacking attempt is detected, it will unlock. Inside, the <b>Proof of Discovery: Radar</b> document can be retrieved.\r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.', '26_11', '60', '10000', '27500', '2700', '1', '1', '0', '0'), ('32370', '306', 'Assembly Station DC105-A', 'This shipyard was probably moved here recently. For now, parts for large vessels are stored in easily accessible silos jutting from the stations surface.', '', '1913', '100000', '100000000', '10000', '1', '2', '0', '0'), ('32371', '314', 'Capital Ship Design  Dictator', 'The Caldari Navy have purportedly worked on this project for the past decade, but lack of funding has kept this new type of capital ship from reaching the pre-production stage. These designs are deemed highly classified and have been kept under wraps in this remote station.', '53_11', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32372', '283', 'Minedrill  E518 Crew', 'This unfortunate crew will supply the Guristas with the intelligence for future raids, assuming they can be made to cooperate. That shouldnt be an issue, though.', '46_01', '0', '100', '3', '0', '1', '0', '0', '0'), ('32374', '280', 'Holoreel GRS-81A', 'The holoreel plays a short message. A mans voice can be heard: \r\n\r\nI need you to listen very carefully, because I don''t have much time. When I was with her, she had a woman there, as well. I know this to be true because I could hear her interrogating the crew. I couldn''t see her until the last days, but when I got loose and crossed to where they were holding her, I saw that there wasn''t much left. It was like that egger had ordered her face to be burnt away or removed.\r\n\r\nI don''t know what she''s planning. Since the accident, she could very well have assumed any identity. It''s possible she doesn''t even-\r\n\r\nThe message ends abruptly. There is something scrawled on the back: Even devils will have their day.\r\n', '10_05', '0', '100', '0.5', '0', '1', '0', '250', '0'), ('32375', '314', 'Proof of Discovery: Ladar Passkey', 'This electronic passkey is provided by tutorial agents as part of a capsuleer training programming. It is used to unlock an acceleration gate inside the Ladar site training area, where the Proof of Discovery documents can be found stored inside containers. The Proof of Discovery documents serve as physical evidence that the capsuleer was able to discover a particular type of site. \r\n\r\nThis passkey is used to unlock Acceleration gates found inside <b>Ladar</b> sites only.', '34_06', '0', '1', '1', '0', '1', '0', '0', '0'), ('32376', '314', 'Proof of Discovery: Ladar', 'This document has been placed inside a Ladar site secured by Empire agents. It serves as physical proof that a capsuleer-in-training has been able to locate the signature through the use of Core Scanner Probes.', '07_03', '0', '1', '1', '0', '1', '0', '0', '0'), ('32377', '306', 'Venal Regional Comms Tower', 'A structure tasked with relaying, boosting, and encrypting data. It seems to be operating at full capacity.', '', '2636', '100000', '27500', '2700', '1', '0', '0', '0'), ('32378', '306', 'Training Container - Gravimetric', 'This container houses the <b>Proof of Discovery: Gravimetric</b> document, which serves as physical proof that a capsuleer-in-training has been able to locate the site through the use of Core Scanner Probes. It must be retrieved to complete the Gravimetric site training mission. \r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.', '26_11', '14', '10000', '27500', '2700', '1', '0', '0', '0'), ('32379', '306', 'Training Container - Ladar', 'This container houses the <b>Proof of Discovery: Ladar</b> document, which serves as physical proof that a capsuleer-in-training has been able to locate the Ladar site through the use of Core Scanner Probes. It must be retrieved to complete the Ladar training mission. \r\n\r\nIf at first the container appears empty, please wait a few minutes for a new document to be provided.', '26_11', '14', '10000', '27500', '2700', '1', '0', '0', '0'), ('32380', '182', 'Roden Police Major', 'The Gallente government contracted this vessel from Roden Shipyards in order to bolster security in Federation space. It is patrolling this sector and will respond to any combat it detects. It can call in reinforcements from nearby sectors if the need arises. Threat level: Extreme', '', '250', '20000000', '1080000', '14000', '1', '8', '0', '0'), ('32381', '182', 'Roden Police Sergeant', 'The Gallente government contracted this vessel from Roden Shipyards in order to bolster the security in Federation space . It is patrolling this sector and will respond to any combat it detects. It can call in reinforcements from nearby sectors if the need arises. Threat level: Very high', '', '38', '2040000', '20400', '160', '1', '8', '0', '0'), ('32382', '306', 'Damaged Caldari Shuttle', 'This tiny craft is badly damaged. All propulsion units have been completely disabled.', '', '47', '1450000', '16120', '145', '1', '1', '0', '0'), ('32383', '314', 'Guristas Dirty Explosive System', 'A rudimentary, though effective, explosion matrix, used specifically for Guristas special operation tactical strikes. Once inside a ships cargo bay, this dirty bomb will, upon detonation, cause massive damage to any ship, structure, or starship base. Its volatility, however, is also a liability: Getting the bomb to its destination is more dangerous than actually utilizing the explosion system.', '54_05', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32384', '671', 'Captured Caldari State Shuttle', 'A captured Caldari state shuttle', '', '50', '1600000', '5000', '10', '1', '1', '0', '0'), ('32385', '612', 'Guristas Battleship Vessel', 'This is a fighter for the Guristas. It is protecting the assets of Guristas and may attack anyone it perceives as a threat or easy pickings. Threat level: Deadly', '', '350', '21000000', '1040000', '235', '1', '1', '0', '0'), ('32386', '226', 'Violent Wormhole', 'Though the wormhole seems stable, the exotic radicals pouring from the tear imply that using it would be catastrophic.', '', '1274', '1', '0', '0', '1', '0', '0', '0'), ('32387', '226', 'Stable Wormhole', 'This wormhole appears to be relatively new. For the time being, it is stable, though excessive traffic and time will eventually cause it to vanish.', '', '1274', '1', '0', '0', '1', '0', '0', '0'), ('32388', '927', 'Angel Recovery Team', 'Sometimes a combat encounter doesnt go the Cartels way, and men and resources are left behind. Rather than leave their fates to scavengers, the Cartel employs its own recovery teams specializing in battlefield salvage and extraction.', '', '660', '12500000', '255000', '5625', '1', '0', '0', '0'), ('32389', '283', 'Dread Guristas Strike Force', 'A troupe of trained specialists, skilled at overtaking stations for the Guristas. This team, calling themselves the Dread Naughts, are a rough bunch, hellfires in the restrictive confines of your cargohold, hardly a disciplined lot during downtime. However, once they are in action, they have the precision to match any elite Empire task force.', '46_09', '0', '80', '1', '0', '1', '0', '0', '0'), ('32390', '672', 'Gath Renton', 'Renton is the CEO of a small capsuleer corporation. For years, he''s managed to stay off the radar of the major alliances. One day, he may achieve his dreams of bigger things; but today, all he has to look forward to is the wrath of the Cartel.', '', '150', '10100000', '101000', '235', '1', '1', '0', '0'), ('32391', '615', 'Yukiro Demense', 'One of the younger commanders in the Guristas Fleet, Yukiro Demense has proven himself capable and aggressive. He and his wingmen are known for their daring raids into State space, as well as their constant harassment of CONCORD and other police forces. Lately, he''s been leading raids on the Angel Cartel and Serpentis in Fountain, becoming quite a thorn in the side of the two larger criminal factions. As yet, he hasn''t drawn any special attention, but it won''t be long until his powerful enemies do something about him.', '', '50', '1650000', '16500', '235', '1', '1', '0', '0'), ('32392', '671', 'Eroma Eralen', 'For whatever reason, Eroma Eralen has never risen very far within the Guristas ranks, despite his nearly twenty year membership in the pirate organization. His superiors blame his erratic behavior, particularly in dealing with small group operations, though others fault his addictions, ranging from interspatial radio technology to low-end boosters to black market pornographic holoreels. He currently acts as Kori Latamakis operative, specializing in covert techno-raids and synthaesthetic manipulation schemes. He can barely be trusted, but he knows what hes doing, though he could just be creating an elaborate practical joke for his own amusement.', '', '50', '1600000', '5000', '10', '1', '1', '0', '0'), ('32393', '314', 'Sealed Research Cache', 'The contents of this container remain sealed behind some kind of proprietary Cartel technology. A thin, red film of hardened fullerene alloys forms a perfect, unbreakable seal around the contents. As if that wasnt enough to deter attackers, the surface underneath the film is covered in tiny nanite-plasma explosives. Any attempt at forced entry past the film would produce enough explosive power to level a small town.', '41_01', '0', '10', '2', '0', '1', '0', '0', '0'), ('32394', '952', 'Serpentis Transport Hub', 'This facility is used by Serpentis research teams to ship goods out of Cartel space and back towards Fountain.', '', '727', '10000', '27500', '2700', '1', '0', '0', '0'), ('32395', '517', 'Atma Aulato''s Falcon', 'A Falcon piloted by an agent.\r\n\r\n\r\n', '', '175', '0', '0', '0', '1', '1', '0', '0'), ('32396', '517', 'Arment Caute''s Lachesis', 'A Lachesis piloted by an agent.', '', '113', '12500000', '116000', '320', '1', '8', '0', '0'), ('32397', '517', 'Yada Vinjivas''s Gila', 'A Gila piloted by an agent.', '', '199.86', '10100000', '101000', '250', '1', '1', '0', '0'), ('32398', '283', 'Lieutenant Kipo Foxfire Tekira', 'Cilis Leglises missing Lieutenant is barely conscious. His legs are no longer functional, and a great deal of his right arm has been removed, almost to the shoulder. Irichi said hes modified this man the same way hed been modified by Cilis, but this is a bit extreme. <br><br> Kipo is obviously under heavy medication. He stares at you, and though he is drugged, his eyes relate a sickening uncertainty. Though he cannot talk, his body language insinuates that he is begging for mercy.', '46_10', '0', '80', '1', '0', '1', '0', '100', '0'), ('32399', '226', 'Statehood Incarnate Monument', 'The Guristas erected this monument years ago, in direct mockery of the massive State-funded public works programs, beautification initiatives, and patriotic displays seen throughout Caldari space. Dubbing this monument, Statehood Incarnate, the entire area is a mockery of the sacred, the glorification of the profane, littered with the true ideals of the Gurista pirates: abject nihilism.', '', '3657', '0', '0', '0', '1', '0', '0', '0'), ('32400', '597', 'Angel Frigate Vessel', 'This is a fighter for the Angel Cartel. It is protecting the assets of the Angel Cartel and may attack anyone it perceives as a threat or easy pickings. Threat level: Very high', '', '50', '1970000', '19700', '235', '1', '2', '0', '0'), ('32401', '595', 'Angel Cruiser Vessel', 'This is a fighter for the Angel Cartel. It is protecting the assets of the Angel Cartel and may attack anyone it perceives as a threat or easy pickings. Threat level: Very high', '', '150', '10100000', '101000', '235', '1', '1', '0', '0'), ('32402', '594', 'Angel Battleship Vessel', 'This is a fighter for the Arch Angels. It is protecting the assets of Arch Angels and may attack anyone it perceives as a threat or easy pickings. Threat level: Deadly', '', '350', '19000000', '19000000', '120', '1', '2', '0', '0'), ('32403', '314', 'Caldari Navy Overlay Transponder', 'This transponder, taken from Koris operative, is your ticket to the rendezvous with the Navy. Barely functional after the destruction of the operatives ship, it contains identification data that will scramble security frequencies, tricking them into identifying your ship as Eromas. ', '34_05', '0', '1', '0.1', '0', '1', '0', '0', '0'), ('32404', '952', 'Cilis Leglise''s Headquarters', 'Cilis Leglise''s Headquarters.', '', '4007', '100000', '27500', '2700', '1', '0', '0', '0'), ('32405', '226', 'Serpentis Research Facility', 'This research facility is use by the Serpentis to conduct experiments considered too dangerous or too secretive to perform in one of their larger stations. It seems that didn''t keep the Guristas from finding out about it, however.', '', '918', '0', '0', '0', '1', '8', '0', '0'), ('32406', '306', 'Caldari Storage Warehouse', 'This is a standard storage facility.', '', '911', '1000000', '1150', '8850', '1', '0', '0', '0'), ('32407', '314', 'Holoreel  Torture Log I15B', 'The grainy footage on this holoreel depicts a young man standing in a small room, his arms bound and his legs chained to the ground, spread apart as far as they can go. His face cannot be seen. The man is bleeding from cuts all across his body. A womans voice asks him an inaudible question. He answers, No. The voice asks another question, also inaudible. The man gives the same response. <br><br>\r\nThis repeats for a few more questions. After the last question, a woman dressed in a Gallente Federation uniform appears. She approaches the man. The man lifts his head, showing his face: It is Irichi. The woman holds his face in his hands, kisses him softly on the lips, and turns to the holoprojector: It is Cilis. She reaches off camera for something. Behind her, Irichis head drops, tears streaming down his face. Cilis returns, holding a remote in her hands. She pushes a button. Mechanical noises reverberate throughout the room. A panel opens beneath Irichis feet. He winces, screams in pain. Loud sawing noises interrupt the scene. The footage goes blank.\r\n', '10_05', '0', '100', '0.5', '0', '1', '0', '250', '0'), ('32408', '314', 'Correspondence Log KL-513', 'A collection of datacores, holoreels, dossiers, and assorted recordings logging the interactions between Kori Latamaki and the Caldari Navy. This information is vital in establishing a treason case against Kori for his dealings with the Navy, with which he has forsaken his brethren in the Guristas. ', '10_16', '0', '1', '0.5', '0', '1', '0', '100', '0'), ('32409', '517', 'Aton Hordner''s Tempest', 'Despite flying with a Republic license, this agent radiates "shady."', '', '250', '0', '0', '0', '1', '2', '0', '0'), ('32410', '517', 'Arajna Ashia''s Arbitrator', 'Arajna is known to have contacts within the Angel Cartel for those willing to expand their horizons.', '', '192', '0', '0', '0', '1', '4', '0', '0'), ('32411', '517', 'Ellar Stin''s Dramiel', 'Ellar Stin, unapologetic Angel.', '', '39', '0', '0', '0', '1', '8', '0', '0'), ('32412', '319', 'Boundless Creations Data Center', 'This massive complex houses hundreds of supercomputers, all dedicated to research and storage. One such superconductor contains the latest Sleepers research from Boundless Creations.', '', '700', '100000', '100000000', '10000', '1', '1', '0', '0'), ('32413', '208', 'Shadow Serpentis Remote Sensor Dampener', 'Reduces the range and speed of a targeted ship''s sensors. This module can be loaded with scripts to increase its effectiveness in certain areas. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.', '04_11', '0', '0', '5', '1', '1', '8', '13948', '0'), ('32414', '379', 'Domination Target Painter', 'A targeting subsystem that projects an electronic "Tag" on the target thus making it easier to target and Hit. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized. ', '56_01', '500', '0', '5', '0', '1', '0', '33264', '0'), ('32415', '504', 'Domination Target Painter Blueprint', '', '02_03', '0', '0', '0.01', '0', '1', '0', '298240', '0'), ('32416', '291', 'Dark Blood Tracking Disruptor', 'Disrupts the turret range and tracking speed of the target ship. This module can be loaded with scripts to increase its effectiveness in certain areas. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.', '05_07', '0', '0', '5', '1', '1', '2', '14828', '0'), ('32417', '291', 'True Sansha Tracking Disruptor', 'Disrupts the turret range and tracking speed of the target ship. This module can be loaded with scripts to increase its effectiveness in certain areas. \r\n\r\nPenalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized.', '05_07', '0', '0', '5', '1', '1', '2', '14828', '0'), ('32418', '314', 'Boundless Creations Security Codes', 'Boundless Creations Security Codes.', '55_11', '0', '1', '1', '0', '1', '0', '0', '0'), ('32419', '226', 'LCO Charon', 'As the makers of the Charon, the Caldari State are generally credited with pioneering the freighter class. \r\nRecognizing the need for a massive transport vehicle as deep space installations constantly increase in number, \r\nthey set about making the ultimate in efficient mass transport - and were soon followed by the other empires. \r\nRegardless, the Charon still stands out as the benchmark by which the other freighters were measured. \r\nIts massive size and titanic cargo hold are rivalled by none.', '', '600', '11150000', '190000', '0', '1', '1', '0', '0'), ('32420', '226', 'LCO Orca', 'The Orca was developed as a joint venture between Outer Ring Excavations and Deep Core Mining Inc as a vessel to help meet the demands of New Eden''s industry and provide a flexible platform from which mining operations can be more easily managed. The Orca uses much of the technology developed by ORE for the Rorqual and integrated with the latest advancements from Deep Core Mining research division has developed a vessel which offers a diverse role to all sizes of operations and needs.', '', '550', '0', '0', '0', '1', '0', '0', '0'), ('32421', '226', 'LCO Hulk', 'The Hulk is the largest craft in the second generation of mining vessels created by the ORE Syndicate. Exhumers, like their mining barge cousins, are equipped with electronic subsystems specifically designed to accommodate Strip Mining modules. They are also far more resilient, better able to handle the dangers of deep space. The Hulk is, bar none, the most efficient mining vessel available. ', '', '250', '11500000', '195000', '0', '1', '0', '0', '0'), ('32422', '1016', 'Advanced Logistics Network', 'This upgrade allows alliances to anchor Jump Bridges on their starbases in a solar system.', '95_12', '0', '1000', '400000', '0', '1', '0', '150000000', '1282'), ('32423', '226', 'LCO Kestrel', 'The Kestrel is a heavy missile boat with a fairly large cargo space and one of the most sophisticated sensor arrays around. Interestingly enough, it has been used by both the Caldari Navy and several wealthy trade corporations as a cargo-hauling vessel. It is one of few trading vessels with good punching power, making it ideal for solo trade-runs in dangerous areas. The Kestrel was designed so that it could take up to four missile launchers but instead it can not be equipped with turret weapons nor mining lasers.', '', '45.98', '1700000', '19700', '305', '1', '1', '0', '0'), ('32435', '256', 'Citadel Cruise Missiles', 'Skill at the handling and firing of Citadel Cruise Missiles. 5% bonus to Citadel Cruise Missile damage per skill level.', '50_11', '0', '0', '0.01', '0', '1', '0', '15000000', '373'), ('32436', '1019', 'Trauma Citadel Cruise Missile', 'Citadel Cruise Missiles are designed for long range bombardment of capital ships and installations. They are a specialized design usable only by capital ships.\r\n\r\nFitted with a graviton pulse generator, this weapon causes massive damage as it overwhelms ships'' internal structures, tearing bulkheads and armor plating apart with frightening ease.', '20_04', '300', '1500', '0.3', '0', '100', '0', '300000', '1287'), ('32437', '166', 'Trauma Citadel Cruise Missile Blueprint', '', '21_02', '0', '1', '0.01', '0', '1', '0', '80000000', '1286'), ('32438', '1019', 'Nova Citadel Cruise Missile', 'Citadel Cruise Missiles are designed for long range bombardment of capital ships and installations. They are a specialized design usable only by capital ships.\r\n\r\nNocxium atoms captured in morphite matrices form this missile''s devastating payload. A volley of these is able to completely obliterate almost everything that floats in space, be it vehicle or structure.', '20_12', '300', '1500', '0.3', '0', '100', '0', '250000', '1287'), ('32439', '166', 'Nova Citadel Cruise Missile Blueprint', '', '21_10', '0', '1', '0.01', '0', '1', '0', '70000000', '1286'), ('32440', '1019', 'Inferno Citadel Cruise Missile', 'Citadel Cruise Missiles are designed for long range bombardment of capital ships and installations. They are a specialized design usable only by capital ships.\r\n\r\nPlasma suspended in an electromagnetic field gives this missile the ability to deliver a flaming inferno of destruction, wreaking almost unimaginable havoc.', '20_08', '300', '1500', '0.3', '0', '100', '0', '325000', '1287'), ('32441', '166', 'Inferno Citadel Cruise Missile Blueprint', '', '21_06', '0', '1', '0.01', '0', '1', '0', '90000000', '1286'), ('32442', '1019', 'Mjolnir Citadel Cruise Missile', 'Citadel Cruise Missiles are designed for long range bombardment of capital ships and installations. They are a specialized design usable only by capital ships.\r\n\r\nNothing more than a baby nuclear warhead, this guided missile wreaks havoc with the delicate electronic systems aboard a starship. Specifically designed to damage shield systems, it is able to ravage heavily shielded targets in no time.', '20_16', '300', '1500', '0.3', '0', '100', '0', '350000', '1287'), ('32443', '166', 'Mjolnir Citadel Cruise Missile Blueprint', '', '21_14', '0', '1', '0.01', '0', '1', '0', '100000000', '1286'), ('32444', '524', 'Citadel Cruise Launcher I', 'The size of a small cruiser, this massive launcher is designed for extended sieges of stationary installations and other large targets.', '95_05', '0', '0', '4000', '4.5', '1', '0', '46052400', '777'), ('32445', '136', 'Citadel Cruise Launcher I Blueprint', '', '21_16', '0', '0', '0.01', '0', '1', '0', '54371400', '340'), ('32446', '927', 'Hostile Hulk', 'The Hulk is the largest craft in the second generation of mining vessels created by the ORE Syndicate. Exhumers, like their mining barge cousins, are equipped with electronic subsystems specifically designed to accommodate Strip Mining modules. They are also far more resilient, better able to handle the dangers of deep space. The Hulk is, bar none, the most efficient mining vessel available.', '', '330', '40000000', '200000', '8000', '1', '8', '0', '0'), ('32447', '927', 'Civilian Hulk', 'The Hulk is the largest craft in the second generation of mining vessels created by the ORE Syndicate. Exhumers, like their mining barge cousins, are equipped with electronic subsystems specifically designed to accommodate Strip Mining modules. They are also far more resilient, better able to handle the dangers of deep space. The Hulk is, bar none, the most efficient mining vessel available.', '', '330', '40000000', '200000', '8000', '1', '8', '0', '0'), ('32448', '875', 'Hostile Orca', 'The Orca was developed as a joint venture between Outer Ring Excavations and Deep Core Mining Inc as a vessel to help meet the demands of New Eden''s industry and provide a flexible platform from which mining operations can be more easily managed. The Orca uses much of the technology developed by ORE for the Rorqual and integrated with the latest advancements from Deep Core Mining research division has developed a vessel which offers a diverse role to all sizes of operations and needs.', '', '550', '250000000', '10250000', '30000', '1', '1', '0', '0'), ('32449', '875', 'Civilian Orca', 'The Orca was developed as a joint venture between Outer Ring Excavations and Deep Core Mining Inc as a vessel to help meet the demands of New Eden''s industry and provide a flexible platform from which mining operations can be more easily managed. The Orca uses much of the technology developed by ORE for the Rorqual and integrated with the latest advancements from Deep Core Mining research division has developed a vessel which offers a diverse role to all sizes of operations and needs.', '', '550', '250000000', '10250000', '30000', '1', '1', '0', '0'), ('32455', '927', 'Ishukone Hauler', 'Industrials are a common sight in the universe of EVE, connecting supply points to each other. Convoys usually have armed escorts, so attacking them is risky.', '', '315', '13500000', '270000', '5250', '1', '1', '0', '0'), ('32456', '701', 'Mordus Escort', 'Contracted for security purposes, Mordus Legion sent this escort in order to protect the interests of Ishukone in the Intaki system. This ship is on sentry duty. Though it has orders to allow traffic through the system, it will fight back if provoked.', '', '221.9', '9600000', '96000', '450', '1', '1', '0', '0'), ('32457', '1006', 'Ishukone Escort', 'Ishukone has sent part of its internal security force to protect the corporations interests in the Intaki system. The megacorporation purchased the system during Tibus Heths blind auction.', '', '150', '10100000', '101000', '235', '1', '1', '0', '0'), ('32458', '1012', 'Infrastructure Hub', 'An Infrastructure Hub is the cornerstone of any empires expansion into nullsec territory.\r\n\r\nOnce online, it allows the owner to cultivate the system it is placed in by applying one of the upgrades available. These upgrades range from simple improvements to a systems financial infrastructure, to defensive upgrades giving the system owner significant advantages.\r\n\r\nAs an added bonus, the Infrastructure Hub functions as a defensive structure as well